import React from 'react';
import './Header.css';

function Header() {
  return (
    <div class="header">
      <img className="logo-img" src="/images/cctracker-logo.png" alt=""></img>
      <span className="logo-txt">CCTracker</span>
    </div>
  )
}

export default Header;
